.container {
  padding-top: 45px;
  display: flex;
  justify-content: space-between;
  align-items: center;
}

.logo {
  color: #454545;
  font-size: 25px;
  font-weight: normal;
  line-height: 40px;
}

ul {
  display: flex;

  li {
    margin-left: 2rem;

    a {
      font-size: 16px;
      color: #757575;
      line-height: 40px;
      padding-right: 22px;
      padding-left: 22px;
      transition: all ease-in-out 0.4s;
    }
  }
}

section {
  height: 85vh;
  position: relative;
  padding-top: 235px;
}

.superhead {
  color: #757575;
  font-size: 10px;
  letter-spacing: 5px;
  text-transform: uppercase;
  margin-bottom: 0.25rem;
}

.headline {
  color: #19191f;
  font-size: 30px;
  line-height: 40px;
  font-family: var(--font-primary);
  margin-bottom: 1.5rem;
  max-width: 500px;
}

.button {
  position: relative;
  display: inline-block;
  font-weight: medium;
  padding: 0 25px;
  background: #5050FF;
  border-radius: 1px;
  transition: transform 0.3s;
  transform-origin: 50% 0;
  transform-style: preserve-3d;
  line-height: 40px;
  -webkit-perspective: 1000px;
  -moz-perspective: 1000px;
  perspective: 1000px;
  color: #ffffff;
}

--color-text: #353535;
--color-text-secondary: #858585;

section {
  padding: 3rem 0;
  .heading {
    color: var(--color-text);
    font-size: 40px;
    margin-bottom: 1.5rem;
  }

  ul {
    display: grid;
    grid-template-columns: 1fr 1fr 1fr;
    gap: 3rem;

    a {
      img {
        margin-bottom: 1.5rem;
      	transition: box-shadow 0.2s;
      }

      span {
        color: var(--color-text-secondary);
        font-size: 10px;
        letter-spacing: 2px;
        text-transform: uppercase;
        margin-bottom: 0px;
        padding-left: 1rem;
      }

      p {
        font-size: 1.2rem;
        font-family: var(--font-primary);
        color: var(--color-text);
        padding-left: 1rem;
        text-decoration: underline;
        text-decoration-color: transparent;  
      	transition: text-decoration-color 0.2s;
      }

      &:hover {
        img {
					box-shadow: 0 20px 25px -5px rgba(0, 0, 0, 0.1), 0 10px 10px -5px rgba(0, 0, 0, 0.04);
        }
        p {
          text-decoration-color: var(--color-text);
        }
      }
    }
  }
}

@media (max-width: 600px) {
  section ul {
    grid-template-columns: auto;
  }
}

